INSERT INTO `config_info` VALUES (762, 'boot-log.xml', 'DEFAULT_GROUP', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<configuration scan=\"true\" scanPeriod=\"60 seconds\">\n\n    <contextName>logback</contextName>\n    <statusListener class=\"ch.qos.logback.core.status.NopStatusListener\"/>\n    <conversionRule conversionWord=\"clr\" converterClass=\"org.springframework.boot.logging.logback.ColorConverter\" />\n    <conversionRule conversionWord=\"wex\" converterClass=\"org.springframework.boot.logging.logback.WhitespaceThrowableProxyConverter\" />\n    <conversionRule conversionWord=\"wEx\" converterClass=\"org.springframework.boot.logging.logback.ExtendedWhitespaceThrowableProxyConverter\" />\n	<conversionRule conversionWord=\"environment\" converterClass=\"com.maozi.log.convert.EnvironmentMessageConverter\" />\n	<conversionRule conversionWord=\"applicationName\" converterClass=\"com.maozi.log.convert.ApplicationNameMessageConverter\" />\n    <springProperty scope=\"context\" name=\"project.environment\" source=\"project.environment\"/>\n    <springProperty scope=\"context\" name=\"spring.application.name\" source=\"spring.application.name\"/>\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    <appender name=\"console-log\" class=\"ch.qos.logback.core.ConsoleAppender\">\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\n                <pattern>%clr([ %d{yyyy-MM-dd HH:mm:ss} ])  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ service：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  %clr([ %m ]){orange}%n</pattern>\n            </layout>\n        </encoder>\n    </appender>\n\n\n    \n	<appender name=\"grpc-log\" class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.log.GRPCLogClientAppender\"></appender>\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    <!-- ALL -->\n    <appender name=\"all-log\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\n        <!-- 文件路径 ，注意LOG_PATH是默认值,它的配置对应application.properties里的logging.path值-->\n        <file>log/log.log</file>\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\n            <!-- 文件名称 -->\n            <fileNamePattern>log/%d{yyyy-MM-dd}-log.log</fileNamePattern>\n            <!-- 文件最大保存历史数量 -->\n            <MaxHistory>30</MaxHistory>\n        </rollingPolicy>\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\n                <pattern>%clr([ %d{yyyy-MM-dd HH:mm:ss} ])  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ service：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  %clr([ %m ]){orange}%n</pattern>\n            </layout>\n        </encoder>\n    </appender>\n    \n    <!-- INFO -->\n    <!-- <appender name=\"info-log\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\n        文件路径 ，注意LOG_PATH是默认值,它的配置对应application.properties里的logging.path值\n        <file>${LOG_DIR:-.}/log/info/info.log</file>\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\n            文件名称\n            <fileNamePattern>log/info/info-%d{yyyy-MM-dd}.log</fileNamePattern>\n            文件最大保存历史数量\n            <MaxHistory>30</MaxHistory>\n        </rollingPolicy>\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\n                <pattern>%clr(%d{yyyy-MM-dd HH:mm:ss})  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ app：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  %clr([ %m ]){orange}%n</pattern>\n            </layout>\n        </encoder>\n        <filter class=\"ch.qos.logback.classic.filter.LevelFilter\">\n            <level>INFO</level>\n            <onMatch>ACCEPT</onMatch>\n            <onMismatch>DENY</onMismatch>\n        </filter>\n    </appender>\n\n    DEBUG\n    <appender name=\"debug-log\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\n        文件路径 ，注意LOG_PATH是默认值,它的配置对应application.properties里的logging.path值\n        <file>${LOG_DIR:-.}/log/debug/debug.log</file>\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\n            文件名称\n            <fileNamePattern>log/debug/debug-%d{yyyy-MM-dd}.log</fileNamePattern>\n            文件最大保存历史数量\n            <MaxHistory>30</MaxHistory>\n        </rollingPolicy>\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\n                <pattern>%clr(%d{yyyy-MM-dd HH:mm:ss})  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ app：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  %clr([ %m ]){orange}%n</pattern>\n            </layout>\n        </encoder>\n        <filter class=\"ch.qos.logback.classic.filter.LevelFilter\">\n            <level>DEBUG</level>\n            <onMatch>ACCEPT</onMatch>\n            <onMismatch>DENY</onMismatch>\n        </filter>\n    </appender>\n    \n    \n    WARN\n    <appender name=\"warn-log\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\n        文件路径 ，注意LOG_PATH是默认值,它的配置对应application.properties里的logging.path值\n        <file>${LOG_DIR:-.}/log/warn/warn.log</file>\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\n            文件名称\n            <fileNamePattern>log/warn/warn-%d{yyyy-MM-dd}.log</fileNamePattern>\n            文件最大保存历史数量\n            <MaxHistory>30</MaxHistory>\n        </rollingPolicy>\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\n                <pattern>%clr(%d{yyyy-MM-dd HH:mm:ss})  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ app：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  %clr([ %m ]){orange}%n</pattern>\n            </layout>\n        </encoder>\n        <filter class=\"ch.qos.logback.classic.filter.LevelFilter\">\n            <level>WARN</level>\n            <onMatch>ACCEPT</onMatch>\n            <onMismatch>DENY</onMismatch>\n        </filter>\n    </appender>\n\n\n\n    ERROR\n    <appender name=\"error-log\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\n        <file>${LOG_DIR:-.}/log/error/error.log</file>\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\n            文件名称\n            <fileNamePattern>log/error/error-%d{yyyy-MM-dd}.log</fileNamePattern>\n            文件最大保存历史数量\n            <MaxHistory>30</MaxHistory>\n        </rollingPolicy>\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\n                <pattern>%clr(%d{yyyy-MM-dd HH:mm:ss})  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ app：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  %clr([ %m ]){orange}%n</pattern>\n            </layout>\n        </encoder>\n        <filter class=\"ch.qos.logback.classic.filter.LevelFilter\">\n            <level>ERROR</level>\n            <onMatch>ACCEPT</onMatch>\n            <onMismatch>DENY</onMismatch>\n        </filter>\n    </appender> -->\n   \n    \n    \n    \n    \n    \n    \n    \n    <appender name =\"console-log-async\" class= \"ch.qos.logback.classic.AsyncAppender\">\n        <discardingThreshold>0</discardingThreshold>\n        <queueSize>512</queueSize>\n        <includeCallerData>false</includeCallerData>\n        <neverBlock>false</neverBlock>\n		<appender-ref ref=\"console-log\" />\n    </appender>\n    \n    <appender name =\"all-log-async\" class= \"ch.qos.logback.classic.AsyncAppender\">\n        <discardingThreshold>0</discardingThreshold>\n        <queueSize>512</queueSize>\n        <includeCallerData>false</includeCallerData>\n        <neverBlock>false</neverBlock>\n		<appender-ref ref=\"all-log\" />\n    </appender>\n    \n    <!-- <appender name =\"info-log-async\" class= \"ch.qos.logback.classic.AsyncAppender\">\n        <discardingThreshold>0</discardingThreshold>\n        <queueSize>1000000</queueSize>\n        <includeCallerData>false</includeCallerData>\n        <neverBlock>false</neverBlock>\n		<appender-ref ref=\"info-log\" />\n    </appender>\n    \n    <appender name =\"debug-log-async\" class= \"ch.qos.logback.classic.AsyncAppender\">\n        <discardingThreshold>0</discardingThreshold>\n        <queueSize>1000000</queueSize>\n        <includeCallerData>false</includeCallerData>\n        <neverBlock>false</neverBlock>\n		<appender-ref ref=\"debug-log\" />\n    </appender>\n    \n    <appender name =\"warn-log-async\" class= \"ch.qos.logback.classic.AsyncAppender\">\n        <discardingThreshold>0</discardingThreshold>\n        <queueSize>1000000</queueSize>\n        <includeCallerData>false</includeCallerData>\n        <neverBlock>false</neverBlock>\n		<appender-ref ref=\"warn-log\" />\n    </appender>\n    \n    <appender name =\"error-log-async\" class= \"ch.qos.logback.classic.AsyncAppender\">\n        <discardingThreshold>0</discardingThreshold>\n        <queueSize>1000000</queueSize>\n        <includeCallerData>false</includeCallerData>\n        <neverBlock>false</neverBlock>\n		<appender-ref ref=\"error-log\" />\n    </appender> -->\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n     \n	\n	<logger name=\"root\" >\n		\n		<if condition=\'property(\"project.environment\").contains(\"localhost\")\'>\n			<then>\n				<appender-ref ref=\"console-log-async\" />\n			</then>\n			<else>\n				<appender-ref ref=\"all-log-async\" />\n			</else>\n		</if>\n		\n		<appender-ref ref=\"grpc-log\" /> \n		\n	</logger>\n	\n<!--  	<logger name=\"com\" level=\"INFO\"> \n		<appender-ref ref=\"info-log-async\" />\n	</logger>\n	\n	<logger name=\"org\" level=\"INFO\">\n		<appender-ref ref=\"info-log-async\" />\n	</logger>\n	  \n	<logger name=\"com\" level=\"DEBUG\">\n		<appender-ref ref=\"debug-log-async\" />\n	</logger> \n	\n	<logger name=\"com\" level=\"WARN\">\n		<appender-ref ref=\"warn-log-async\" /> \n	</logger>\n	\n	<logger name=\"com\" level=\"ERROR\">\n		<appender-ref ref=\"error-log-async\" />\n	</logger>\n	\n	<logger name=\"org\" level=\"ERROR\">\n		<appender-ref ref=\"error-log-async\" />\n	</logger> -->\n	\n	\n</configuration>\n\n\n\n\n\n\n', 'cd74227855df7516ece41512bf673d33', '2023-06-01 22:35:04', '2024-01-02 10:39:00', 'nacos', '172.30.0.1', '', '', '', '', '', 'xml', '');
INSERT INTO `config_info` VALUES (1480, 'maozi-cloud-system.yml', 'DEFAULT_GROUP', 'project:\n  title: 系统服务\n  details: 管理 用户、角色、权限、系统配置 等功能\n\napplication-port: ${application-dev-port:2000}\napplication-dubbo-port: ${application-dev-dubbo-port:20881}\n\n# application-datasource-jdbc-url: localhost:3306/maozi-cloud-test-db\n# application-datasource-jdbc-username: root\n# application-datasource-jdbc-password: password\napplication-datasource-db-name: maozi-cloud-system-localhost-db\n\napplication-project-whitelist: /user/platform/v1/getToken,/config/global/system/get\n\napplication-project-system: \n  projectName: 小猫子\n  corporationName: 小猫子\n  icon: http://dummyimage.com/100x100\n  environment: ${project.environment}\n  description: 小猫子个人脚手架\n  copyright: 本网站所有权归《${application-project-system.corporationName}》所有，请勿抄袭和抄袭', 'b393ade6e481f09df79b30d5b01bda35', '2023-06-11 10:18:10', '2024-02-14 01:12:13', 'nacos', '172.18.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (1483, 'maozi-cloud-monitor.yml', 'DEFAULT_GROUP', 'project:\n  title: 监控服务\n  details: 监控 JVM、运行状态、配置、连接中间件状态 等功能\n\napplication-port: ${application-dev-port:8000}\n\nspring:\n  security:\n    user:\n      name: admin\n      password: admin\n      \n  boot:\n    admin:\n      discovery: \n        services: maozi-cloud-*\n      ui:\n        external-views:\n        \n          - label: \"注册中心\"\n            url: \"http://maozi-cloud-nacos:8848/nacos/#/configurationManagement?dataId=&group=&appName=&namespace=&pageSize=&pageNo=\"\n            iframe: true\n            order: 2002\n\n          - label: \"接口文档\"\n            url: \"https://localhost:10000/doc.html\"\n            iframe: true\n            order: 2003\n\n          - label: \"容器管理\"\n            url: \"http://localhost:9000\"\n            iframe: true\n            order: 2004\n\n          - label: \"Arthas管理\"\n            url: \"http://localhost:9080\"\n            iframe: true\n            order: 2005', '71dec651b647f8507ae60f65686f78a1', '2023-06-11 10:22:41', '2024-01-02 15:24:38', 'nacos', '172.30.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (1497, 'maozi-cloud-oauth.yml', 'DEFAULT_GROUP', 'project:\n  title: 认证授权服务\n  details: 管理 三方认证授权、客户端 等功能\n\napplication-port: ${application-dev-port:1000}\napplication-dubbo-port: ${application-dev-dubbo-port:20880}\n\n# application-datasource-jdbc-url: localhost:3306/maozi-cloud-test-db\n# application-datasource-jdbc-username: root\n# application-datasource-jdbc-password: password\n\napplication-datasource-db-name: maozi-cloud-oauth-localhost-db\n\napplication-redis-database: 3\n\napplication-project-whitelist: /oauth/check_token,/oauth/token/get,/oauth/token/refresh,/oauth/token/**/check,/oauth/token/**/destroy', '0ae7d63b37ac05a0d6fd1d09b62b9db3', '2024-01-02 10:40:48', '2024-01-02 15:23:26', 'nacos', '172.30.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (1515, 'boot-lock.yml', 'DEFAULT_GROUP', 'spring:\n  lock:\n    address: redis://${spring.redis.host}:${spring.redis.port}\n    password: ${spring.redis.password}\n    database: ${spring.redis.database:0}\n    #waitTime: 60 #获取锁最长阻塞时间（默认：60，单位：秒）\n    #leaseTime: 60 #已获取锁后自动释放时间（默认：60，单位：秒）\n    #redis集群配置 如 redis://127.0.0.1:7000,redis://127.0.0.1:7001,redis://127.0.0.1:7002\n    #spring.klock.address 和 spring.klock.cluster-server.node-addresses 选其一即可\n    #cluster-server.node-addresses:', 'dfcea422e2f25895e472925c73de2f8b', '2024-01-02 15:26:36', '2024-01-02 15:55:28', 'nacos', '172.30.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (1519, 'boot-monitor.yml', 'DEFAULT_GROUP', 'spring:  \r\n  security:\r\n    user:\r\n      name: admin\r\n      password: admin\r\n  boot: \r\n    admin: \r\n      discovery: \r\n        services: maozi-cloud-*\r\n      client:\r\n        # url: http://localhost:8000\r\n        username: admin\r\n        password: admin\r\n        # auto-deregistration: true\r\n        # instance: \r\n        #   prefer-ip: true\r\n        #   metadata: \r\n        #     tags: \r\n        #       environment: 本地\r\n\r\nendpoints:\r\n  dubbo:\r\n    enabled: true\r\n\r\nmanagement:\r\n  info.env.enabled: true\r\n  health:\r\n    dubbo:\r\n      status:\r\n        defaults: memory\r\n        extras: load,threadpool\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n  endpoint:\r\n    dubbo:\r\n      enabled: true\r\n    dubbo-shutdown:\r\n      enabled: true\r\n    dubbo-configs:\r\n      enabled: true\r\n    dubbo-services:\r\n      enabled: true\r\n    dubbo-references:\r\n      enabled: true\r\n    dubbo-properties:\r\n      enabled: true\r\n    health:\r\n      show-details: ALWAYS\r\n      probes.enabled: true', '6d9bdb9efc506c1238d1f1541f54c004', '2024-01-02 15:28:35', '2024-01-02 15:28:35', NULL, '172.30.0.1', '', '', NULL, NULL, NULL, 'yaml', NULL);
