INSERT INTO `his_config_info` VALUES (102, 1822, 'maozi-cloud-gateway.yml', 'DEFAULT_GROUP', '', 'project:\n  title: 网关服务\n  details: 处理 流量分发、黑白名单、流控 等功能\n\napplication-port: ${application-dev-port:10000}\n\napplication-project-name: gateway\n\nknife4j:\n  gateway:\n    enabled: true\n    strategy: discover\n    discover:\n      version: openapi3\n      enabled: true\n\nspring: \n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      datasource:\n        gw-flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-flow\n            groupId: SENTINEL_GROUP\n            rule-type: gw-flow\n        gw-api-group:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-api-group\n            groupId: SENTINEL_GROUP\n            rule-type: gw-api-group\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n\n\n      default-filters:\n      - StripPrefix=1\n      - name: Retry\n        args:\n          retries: 1\n          methods: GET,POST\n          statuses: BAD_GATEWAY,GATEWAY_TIMEOUT,SERVICE_UNAVAILABLE\n          series: INFORMATIONAL\n          exceptions: java.net.ConnectException,org.springframework.cloud.gateway.support.NotFoundException\n\n\n      routes: \n        - id: MAOZI-CLOUD-SYSTEM\n          uri: lb://maozi-cloud-system\n          predicates:\n          - Path=/system/**\n\n        - id: MAOZI-CLOUD-OAUTH\n          uri: lb://maozi-cloud-oauth\n          predicates:\n          - Path=/oauth/**\n          # filters:\n          #- StripPrefix=1\n          # - WSProtocolFilter\n\n      # default-filters:\n      #   - name: Hystrix\n      #     args:\n      #       name: default\n      #       #转发地址\n      #       fallbackUri: \'forward:/fallback\'\n      #   - name: Retry\n      #     args:\n      #       #重试次数，默认值是 3 次\n      #       retries: 3\n      #       #HTTP 的状态返回码\n      #       statuses: BAD_GATEWAY,BAD_REQUEST\n      #       #指定哪些方法的请求需要进行重试逻辑，默认值是 GET 方法\n      #       methods: GET,POST', '67dcda83a6bd09acfb90fe6d3900b7eb', '2024-01-20 02:31:42', '2024-01-20 10:31:42', 'nacos', '172.30.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (102, 1823, 'maozi-cloud-gateway.yml', 'DEFAULT_GROUP', '', 'project:\n  title: 网关服务\n  details: 处理 流量分发、黑白名单、流控 等功能\n\napplication-port: ${application-dev-port:10000}\n\napplication-project-name: gateway\n\nknife4j:\n  gateway:\n    enabled: true\n    strategy: discover\n    discover:\n      version: openapi3\n      enabled: true\n      excluded-services:\n        - dubbo-*\n\nspring: \n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      datasource:\n        gw-flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-flow\n            groupId: SENTINEL_GROUP\n            rule-type: gw-flow\n        gw-api-group:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-api-group\n            groupId: SENTINEL_GROUP\n            rule-type: gw-api-group\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n\n\n      default-filters:\n      - StripPrefix=1\n      - name: Retry\n        args:\n          retries: 1\n          methods: GET,POST\n          statuses: BAD_GATEWAY,GATEWAY_TIMEOUT,SERVICE_UNAVAILABLE\n          series: INFORMATIONAL\n          exceptions: java.net.ConnectException,org.springframework.cloud.gateway.support.NotFoundException\n\n\n      routes: \n        - id: MAOZI-CLOUD-SYSTEM\n          uri: lb://maozi-cloud-system\n          predicates:\n          - Path=/system/**\n\n        - id: MAOZI-CLOUD-OAUTH\n          uri: lb://maozi-cloud-oauth\n          predicates:\n          - Path=/oauth/**\n          # filters:\n          #- StripPrefix=1\n          # - WSProtocolFilter\n\n      # default-filters:\n      #   - name: Hystrix\n      #     args:\n      #       name: default\n      #       #转发地址\n      #       fallbackUri: \'forward:/fallback\'\n      #   - name: Retry\n      #     args:\n      #       #重试次数，默认值