INSERT INTO `his_config_info` VALUES (1480, 2218, 'maozi-cloud-system.yml', 'DEFAULT_GROUP', '', 'project:\n  title: 系统服务\n  details: 管理 用户、角色、权限、系统配置 等功能\n\napplication-port: ${application-dev-port:2000}\napplication-dubbo-port: ${application-dev-dubbo-port:20881}\n\n# application-datasource-jdbc-url: localhost:3306/maozi-cloud-test-db\n# application-datasource-jdbc-username: root\n# application-datasource-jdbc-password: password\napplication-datasource-db-name: maozi-cloud-system-localhost-db\n\napplication-project-whitelist: /user/platform/v1/getToken,/config/global/system/get,/test\n\napplication-project-system: \n  projectName: 小猫子\n  corporationName: 小猫子\n  icon: http://dummyimage.com/100x100\n  environment: ${project.environment}\n  description: 小猫子个人脚手架\n  copyright: 本网站所有权归《${application-project-system.corporationName}》所有，请勿抄袭和抄袭\n\n\nspring:\n  cloud: \n    stream:\n      function:\n        definition: test;filter\n      rocketmq:\n        binder:\n          name-server: localhost:9876\n        bindings:\n          test-out-0:\n            producer:\n              group: test-group\n              vipChannelEnabled: false\n              sendMsgTimeout: 9000\n              sendType: Async\n          filter-out-0:\n            producer:\n              group: filter-group\n              vipChannelEnabled: false\n              sendMsgTimeout: 9000\n              sendType: Async\n      bindings:\n        test-out-0: \n          destination: test-topic\n          content-type: application/json\n        filter-in-0:\n          destination: test-topic\n          group: filter-group\n          content-type: application/json\n        filter-out-0: \n          destination: filter-topic\n          content-type: application/json\n        test-in-0:\n          destination: filter-topic\n          group: test-group\n          content-type: application/json', '8bce3d641f096e137983ac722edbc94f', '2024-01-27 11:03:02', '2024-01-27 19:03:03', 'nacos', '172.30.0.1', 'U', '');
